        factoryAction?.Invoke(codeEditorAppSettingsResult);

        return codeEditorAppSettingsResult;
    }

    private Humidifier.SageMaker.UserProfileTypes.CodeEditorAppSettings CreateCodeEditorAppSettings()
    {
